import React from "react";
import "./home.css";

const Home = () => {
  return (
    <div className="home-container">
      <div className="content">
        <h1>Welcome to Task Management</h1>
        <p>Task management helps individuals and teams organize, prioritize, and track tasks to improve productivity and project completion.<br/><br/>
        
        This app includes like Asana, Todoist, ClickUp, Trello, Wrike, and others, offering features like task lists, project boards, and collaboration tools. </p>
      </div>
    </div>
  );
};

export default Home;
